import React from "react";

import Stack from "@mui/material/Stack";
import Typography from "@mui/material/Typography";

import { useTheme } from "@mui/material/styles";

import Footer from "../Footer/Footer";

const MyClassItem = () => {
  const theme = useTheme();
  const poppins = theme.typography.poppins.fontFamily;
  const gray1 = theme.palette.gray1.main;
  const gray3 = theme.palette.gray3.main;

  return (
    <Stack
      direction="row"
      spacing={3}
      sx={{ paddingBottom: "24px", borderBottom: "1px solid #BDBDBD" }}
    >
      <img src="./classcarddetailimg.svg" width="200" height="133" />

      <Stack spacing={1} sx={{ alignSelf: "center", textAlign: "left" }}>
        <Stack spacing="4px">
          <Typography
            component="div"
            sx={{ color: gray3, fontFamily: poppins }}
          >
            Asian
          </Typography>
          <Typography
            variant="h5"
            component="h2"
            sx={{ color: gray1, fontFamily: poppins, fontWeight: "600" }}
          >
            Tom Yum Thailand
          </Typography>
        </Stack>

        <Typography variant="h6" component="div" color="secondary">
          Schedule : Wednesday, 27 July 2022
        </Typography>
      </Stack>
    </Stack>
  );
};

const MyClassPage = () => {
  return (
    <div>
      <Stack
        spacing={3}
        sx={{
          width: "1137px",
          margin: "0 auto",
          marginTop: "40px",
          marginBottom: "424px",
        }}
      >
        <MyClassItem />
      </Stack>

      {/* <Footer /> */}
    </div>
  );
};

export default MyClassPage;
